profile:
Le candidat idéal :
* Compétences scientifiques : rigueur, logique, esprit analytique; 
* Curiosité, sens du détail et prise d'initiatives;
* Capacité à creuser des problèmes complexes;
* Force de proposition: identifier les suites à donner à vos résultats et proposer des solutions adaptées; 
* Esprit de synthèse;
* Sens de la pédagogie et capacité à présenter ses conclusions de manière concise (claire et précise) pour faciliter la prise de décision;
* A l’aise avec SQL;
* Connaissance de Python et des frameworks classiques en data (Numpy, Pandas, Scikit learn etc.);
* Expérience avec un outil de DataViz (Tableau par exemple) est un plus;
* A l'aise dans la langue de Shakespeare; 
* Bonne compréhension des challenges data engineering est un plus;

Diplômé d'un Bac+5, tu as une expérience significative d'au moins 3 ans dans le domaine de la Réponse sur Incident et de l'Investigation Numérique.
Compétences & Qualités recherchées :
* Bonne connaissance des systèmes d'exploitation courants (Windows, Linux) et des artefacts associés;
* Maîtrise des outils de collecte et d'analyse de traces numériques;
* Connaissance des systèmes d'information d'entreprise (Active Directory, Office 365, etc.);
* Très bonnes qualités rédactionnelles en anglais et en français;
* Esprit d'analyse et de synthèse;
* Développement Python.
Pourquoi rejoindre SEKOIA ?
* Nos valeurs sont simples, efficaces et profondément ancrées dans nos habitudes de travail : collaboration, bienveillance et innovation. Au sein de notre équipe au quotidien, ou dans notre relation clients, ces valeurs sont la source d’un progrès constant et l’envie de nous dépasser en permanence !
* Possibilité de remote 3 jours par semaine
* Mutuelle prise en charge à 100% par SEKOIA
* Des locaux lumineux et conviviaux, une terrasse pour les barbecues, et une équipe adorable avec qui tu travailleras tous les jours avec plaisir 😊

Diplôme supérieur : Licence / master (de type NTIC, Commerce, Marketing, Ingénieur)
-Expérience 3-5 ans dans le marketing numérique ou l'analyse de données  ; 
Bonne connaissances SQL / Python ;
Avoir déjà manipulé des outils de data-visualisation
Analytique avec une grande capacité à synthétiser et structurer les enseignements ;
Grande curiosité et capacité d'adaptation ;
Intérêt pour les médias, la culture, l'information et les nouvelles technologies ; 
Fortes capacités de communication permettant de travailler en équipe pluridisciplinaire et de prendre en compte les contraintes inhérentes aux différents métiers impliqués (produit, éditorial, technique, commercial…) ; 
Proactivité dans les analyses ;
Capacité à mener plusieurs projets en parallèle et en autonomie ;
Les médias et la radio en particulier vous intéressent ;
Adhésion aux valeurs du service public et la mission de Radio France en tant que service de l'audiovisuel public.

You'll be a great fit for the job if you have:

Rigor: be confident in your calculus and extremely rigorous so that we can always trust the output derived from the data;
Intellectual honesty: data is what it is, you don’t try to twist your analysis to get the expected results but rather provide all insights to understand why you obtain those results;
Ability to abstract, decompose and solve a complex problem with data and then expose it with intuitive data visualization tools;
Good oral skills to convey the results of the analysis;
Technical requirements: statistics, SQL, Power-BI, PowerPoint;
Either from a business background with solid statistics knowledge, or from an engineer background with a great sense of business and analytical skills.

You'll be a great fit for the team if you have:

A Getting things done attitude: will to achieve, problem-solving enthousiast, result-driven, positive attitude towards obstacles.
Teamwork player: you welcome collaboration, understand your role and duty within the team. You’re nice to others and contribute to the positive lifestyle of our company.
Empowerment: everyone has ownership on his/her scope. We value your contribution and expect you to be a reference in your domain.
Honesty: giving honest and direct feedback to others on their work is critical to both you and the organisation: it's the main driver of progress and learning. It also means you are eager to learn from others and you value their opinion.
Ability to work in a fast-growing company: comfortable with agility, evolving scopes and working on very different items.
Excellence: you are enthusiastic to become better at what we’re doing, eager to learn constantly, and you can be flexible to adapt and evolve to reach the highest standards in your domain.

Notre candidat idéal :
Une formation en Statistique avec un niveau Bac +5; 
Connaissance en base de données, statistique et informatique (SAS et R) ; 
Et pour le reste : surprenez-nous par vos qualités !

Formation bac+5 type école d’ingénieur, doctorat ou équivalent ;
Maîtrise de SQL et de la création de schémas de données ;
Maîtrise de Debian ou de Ubuntu, de Shell et de l’environnement Linux ;
Une première expérience en développement sur des infrastructures informatiques de type Big Data (Cassandra, Elasticsearch etc…) ;
Culture DevOps (omniprésence du monitoring, automatisation des tâches ...) ;
Compréhension de la culture et du besoin des différents membres de l’équipe.

Benefits
Tu hésites ? On te dit pourquoi il faut nous rejoindre :
* Nos équipes sont jeunes, dynamiques et travaillent avec passion.
* Nous avons gardé notre esprit start-up et aimons célébrer ensemble chacune de nos réussites !
* L’agilité et la réactivité sont nos maîtres-mots.
* Tu deviendras bêta-testeur et tu contribueras directement au développement et à l’amélioration continue de nos produits.
* Nous sommes des mordus de sport et t’accueillerons avec plaisir dans nos différentes teams.
* Nous sommes bien situés (ligne 12 Porte de Versailles ou Corentin Celton) et tu pourras déjeuner (italien, asiatique, fast-food etc) mais aussi bouger (parcs, complexes sportifs) selon tes envies !

Formation bac+5 type école d’ingénieur, doctorat ou équivalent ;
Profil orienté Data avec une forte appétence pour l’amélioration de l’expérience utilisateur ;
Maîtrise des thématiques Produits / Business ;
Une première expérience en Product Management et/ou analyse des comportements utilisateurs avec Google Analytics et/ou Amplitude ;
Maîtrise de SQL, de Python et de la création de schémas de données.

