3+ years of experience in quantitative analysis & data science or a related field;
Fluency in SQL;
Experience with a programming language, like Python;
Familiarity with Amplitude is a plus;
Experience with creating visuals and dashboards;
Excellent verbal and written communication skills, high attention to detail;
Ability to take initiative and employ good judgement;
Ability to act as a team player and collaborate across teams;
Experience in a product-focused role at a social media or mobile technology related company is a plus.

EXPERIENCE & SKILLS REQUIRED

7-10+ years of experience building and managing a sales team of 20+ in a SaaS environment, where speed is key;
Experience in short sales cycle, focused on closing fast.
Demonstrated hands-on experience and ready to build a team & processes almost from scratch at a fast pace;
Commercial stamina, supported by a customer-first approach
Fluent across sales and CRM automation tools and an expert in defining & documenting processes, ensuring standardization, implementing automation opportunities and increasing team’s productivity; extensive knowledge of Salesforce would be a plus;
Knowledge over lead generation tactics and lead scoring tools;
Strategy leader with excellent verbal & written communication skills;
Experience hiring, mentoring, coaching & retaining a high-performing team (20+), exhibiting poise & dynamism to motivate and spread confidence;
Have worked in a cross-functional environment along with marketing, data analysts & PMs.

OTHER REQUIREMENTS
Action-driven: you are curious about quickly testing new initiatives, collecting results and feedback, before scaling your efforts:
Data mindset: you make decisions based on reliable data you collect and challenge your stakeholders, based on specific metrics;
Work environment: experience working in a fast-growing company, where speed is key;
Coach attitude: you are a player but most & foremost a strong coach, able to motivate & inspire your team to become everyday better at what they do;
Collaborative: you communicate constructively learnings collected from clients and you build processes in sync with other teams;
Passion for making a difference: you are interested in ed tech and how online education platforms can have a social impact;
Tools: knowledge of Hubspot, Salesforce, Google Analytics would be a plus;
English required: you have at least a C1-level of English.

Compétences techniques
● au moins 3 ans d’expérience dans la gestion d’incidents de sécurité au sein d’un SOC ou
une cellule sécurité opérationnelle ;
● Bonne connaissance technique des technologies de sécurité telles que Firewall Next-
Generation, WAF, IPS/IDS, Proxy, EDR, SIEM, IAM ;
● Bonne connaissance d’un outil de SIEM et expérience sur la mise en place d’alertes et
reporting à travers cet outil ;
● Connaissance des référentiels de sécurité étatiques tel que le Référentiel Général de
Sécurité, publié par l’ANSSI ou d’autres ressources similaires ;
● Des connaissances des technologies et standards de gestion de données dans
l’environnement médical est un plus (DICOM/PACS, Fhir, …).
Compétences personnelles et relationnelles
● Exigence, rigueur et excellence ;
● Esprit entrepreneurial, curieux, goût du changement et bonne capacité d’adaptation ;
● Excellentes qualités d’organisation, de planification et de rigueur.

EXPERIENCE & SKILLS REQUIRED

2-5+ years of experience working in an inside sales team in a SaaS environment, where speed is key;
Sales Experience in short sales cycles, focused on closing fast.
Demonstrated hands-on experience and ready structure and share processes almost from scratch at a fast pace;
Clear understanding of key sales metrics (quota, reach rate, answer rate, enrollment rate etc.), the ability to report on the relevant KPIs and to make recommendations on how to improve performance for each;
Knowledge over lead generation tactics and lead scoring tools;
Strategy leader with excellent verbal & written communication skills;
Have worked in a cross-functional environment along with marketing, sales ops, data analysts & PMs.

OTHER REQUIREMENTS

Action-driven: you are curious about quickly testing new initiatives, collecting results and feedback, before scaling your efforts:
Data mindset: you make decisions based on reliable data you collect and challenge your stakeholders, based on specific metrics;
Work environment: experience working in a fast-growing company, where speed is key;
Coach attitude: you are a player but most & foremost a strong coach, able to motivate & inspire your team to become everyday better at what they do;
Collaborative: you communicate constructively learnings collected from clients and you build processes in sync with other teams;
Passion for making a difference: you are interested in ed tech and how online education platforms can have a social impact;
Tools: knowledge of Hubspot, Salesforce, Google Analytics would be a plus;
English required: you have at least a C1-level of English.

WHAT WE OFFER
Pass Navigo paid by OpenClassrooms
Health insurance for free (“Mutuelle” monthly fee entirely paid by OpenClassrooms)
Meal vouchers (Employer contribution at the max authorized by law)
Access to gym for free (Gymlib paid by OpenClassrooms)
Unlimited days off and a 1.000€ premium once a year for 15+ days off taken
Access to remote working
A company MacBook
A work environment and a strong culture built on agility, openness, respect and high quality
👉 OpenClassrooms is a French hyper-growth company eligible to the French Tech Visa program. That means, for foreign candidates, benefiting from the accelerated procedure to apply for a "Talent Passport" residence permit. There is also a simplified "accompanying family" procedure available for spouse and dependent minor children.
More information here: https://visa.lafrenchtech.com/4/french-tech-visa-for-employees
👉 We value diversity and welcome everyone who wants to join us and make education accessible. We are at an exciting moment and we deeply believe that various backgrounds and experiences will lead to a better product for our students.
👉 Working at OpenClassrooms means joining a dynamic and stimulating team, take up challenges, meet awesome people every week, and change the world, a little bit, every day! 🌎

About you
We are looking for someone with:

Strong technical leadership experience; you bring at least 10 years of data engineering and 5 years of leadership experience to the table;
A deep dive knowledge of Information System of Hospitals; 
Experiences on Health Data management and FAIR principles;
Data and ML expertise; in-depth experience with large-scale cloud-based data and ML infrastructure as well as tooling landscape (e.g. Spark, Presto, Exadata, Exasol, Databricks, BigQuery, and SageMaker);
Customer focus; a deep understanding of the requirements of key data stakeholders like data scientists, data engineers or data analysts;
Visionary and strategic mindset; you can define, develop and advocate a product vision and strategy, have a progressive approach and the ability to introduce and inspire change. You work through mechanisms, not meetings;
Excellent communication : you are able to inform, convince and persuade a range of stakeholders, also on executive level, in both verbal and written form;
Business acumen : you are able to manage a cost center with a high cost footprint; has an eye for cost-efficiency as well as contract negotiation experience.

What we offer

Competitive salary and equity;
Opportunity to work with an international team with high technical and scientific backgrounds;
Friendly and informal working environment;
Flexible work organization and access to remote work;
7 weeks of paid vacation per year (depending on where you are based);
Beautiful and well positioned offices in Paris (Petites Ecuries), London (Holborn), Nantes (historic Center) and NYC (Union Square) with numerous and various team activities and events.

