Conditions de la mission :
* Durée du stage : 6 mois, plein temps (pas d’alternance) ;
* Date de début : juillet 2021 ;
* Lieu : Equancy France, 47 rue de Chaillot, 75116 Paris ;
* Rémunération : 1300€ + tickets restaurant + remboursement 50 % carte de transport.

